import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../Styles/style0.css';
import {Accordion, Card, Button} from 'react-bootstrap';
import CardsContent from './sCards.json';
const jsonArr = JSON.stringify(CardsContent.CardsContent);
const services = () => {
    let hdArr = ["Click me1!" , "Click me2!"],
        bdArr = ["This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer."
                ,"Hello! I'm another body : This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer."];
    console.log(jsonArr.slice(jsonArr.search('"',0)+1,5));
    console.log(jsonArr.slice(jsonArr.search('"',2),15));
    return (        
        <>
            <Accordion defaultActiveKey="0">
                <Card>
                    <Card.Header>
                        <Accordion.Toggle as={Button} variant="link" eventKey="0">
                            {/*Click me!*/} {/*hdArr[0];*/}
                            {jsonArr[0]}                            
                        </Accordion.Toggle>
                    </Card.Header>
                    <Accordion.Collapse eventKey="0">
                        <Card.Body>This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</Card.Body>
                    </Accordion.Collapse>
                </Card>
                <Card>
                    <Accordion.Toggle as={Card.Header} className={`btn btn-link text-left pl-4`} variant="link" eventKey="1">
                        {/*Click me!*/} {hdArr[1]};
                    </Accordion.Toggle>
                    <Accordion.Collapse eventKey="1">
                        <Card.Body>Hello! I'm another body : This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</Card.Body>
                    </Accordion.Collapse>
                </Card>
            </Accordion>
        </>
    );
};

export default services;
